1.Giao hàng sớm hơn dự kiến 1 ngày;
2.Sản phẩm là Made in Thailand;
3.Dễ sử dụng;
4.Giá hợp lý;
5.Mẫu mã ưa nhìn.

Lúc mình mua SP về test lần đầu bị lỗi E1. Liên hệ Tiki để đổi hàng thì bạn shipper qua đổi luôn trong vòng 1 hay 2 ngày sau đó, sau đó mình nhận hàng thì SP dùng rất tốt. Hiện tại chưa thấy vấn đề gì.
 Lời khuyên cho các bạn khi mua hàng
- Mua về khui ra, test ngay để nhỡ có hỏng thì trong thời gian đổi-trả sẽ được Tiki hỗ trợ. Giữ nguyên phụ kiện đi kèm hộp để đóng gói hàng;
- Để nấu các món ngon chỉ cần nhớ nguyên tắc, đầu tiên set nhiệt thấp để chín, sau set nhiệt cao để giòn bề mặt;
- Mua thêm giấy nến để lót mấy đồ dầu mỡ, dễ vệ sinh nồi. Tất nhiên nhược điểm là lâu khô món ăn hơn vì ko thoát được nước, dầu (tùy món mà ta customise).

Hết. Cảm ơn Tiki mang đến một trải nghiệm tốt cho mình với giá cả rẻ hơn các sàn TMĐT khác hehe.

Tôi mới nhận hàng hôm qua (3-2-2020):
1. Hàng đẹp, lồng nồi chắc chắn, dày, nặng;
2. Có tấm ngăn để hấp (như hình ảnh trên mạng);
3. Hàng chính hãng (mình có lên website của Toshiba Việt Nam kiểm tra và đăng ký bảo hành)
4. Mình nấu thử thì: cơm ngon (lượng nước như trong hướng dẫn), không đọng nước trên nắp nồi (có một số bạn nhận xét là có nước trên nắp nồi);
5. Mình thử chế độ Warm trong 12h, sáng kiểm tra thấy cơm vẫn nóng (cơm vẫn như lúc nấu), nước cũng không thấy đọng trên nắp;
6. Độ bền: chưa khẳng định được, phải đợi một khoảng thời gian mới biết.
